import { lazy, Suspense } from "react";
import { Route, Routes } from "react-router-dom";
import routesFront from "../../../routes/routesFrontend.routes";
const IndexMain = lazy(() =>
  import("../index").then((m) => ({
    default: m.MainIndex,
  }))
);
export const RouterMain = () => {
  return (
    <Route
      path={routesFront.main}
      element={
        <Suspense fallback={<div>Loading...</div>}>
          <IndexMain />
        </Suspense>
      }
    ></Route>
  );
};
